from typing import List

class Solution:
    def numSubseq(self, nums: List[int], target: int) -> int:
        N = len(nums)
        nums.sort()
        left, right = 0, N - 1
        res = 0
        MOD = 10**9 + 7
        while left <= right:
            if nums[left] + nums[right] > target:
                right -= 1
            else:
                #res = (res + 2**(right - left)) % MOD
                res = (res + (1 << (right - left))) % MOD  # Fantastic improvement!!!
                #res += 2**(right - left)
                left += 1
        #res = res % MOD
        return res

